import React from "react";
import "./ChatRoom.css";

class ChatRoom extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return <div className="chatroom">
      <button type="button" class="btn btn-primary">Primary</button>
    </div>;
  }
}

export default ChatRoom;
